import React from 'react';
import img from '../Images/carsouel2.jpg';

export default function CategoryCard(props) {
  return (
    <div className="col-lg-4 col-md-6 col-sm-12 my-3">
      <div className="card" style={{ width: '100%' }}>
        <img src={img} className="card-img-top" alt="Recipe Category" />
        <div className="card-body">
          <h5 className="RecipeCategory">{tit}</h5>
          <a href="#" className="btn btn-primary">Get Recipes</a>
        </div>
      </div>
    </div>
  );
}
